// src/About.js
import React from 'react';

const About = () => {
  return (
    <section id="about">
      <h2>About Me</h2>
      <p>I am Aryan Jha, a 3rd year B.Tech student at IIIT Manipur, specializing in Computer Science, AI, and Data Science. I am currently serving as the sports secretary.</p>
    </section>
  );
};

export default About;
